  return (
    <div className="font-sans bg-gray-100 min-h-screen">
      <header className="bg-blue-600 text-white p-4 text-center">
        <h1 className="text-4xl font-bold">Welcome to LLM Quiz & Interview Prep</h1>
        <p className="mt-2">Enhance your learning and job preparation with AI</p>
      </header>
      <main className="p-8">
        <UploadSection />
        <FeaturesSection />
      </main>
      <Footer />
    </div>
  );
}
